import React from 'react';

const Header = () => {
  return (
    <div className='bg-gray-200'>
      <h1>
        <img
          className='h-24 mx-auto py-4'
          src='/logo.png'
          alt='Ola FSL!!!'
          height='60'
        />
      </h1>
      <div className='bg-gray-500'>Navbar</div>
    </div>
  )
}

export default Header;
